class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        for x in t:
            if s.count(x) < t.count(x):
                return x
        return ''
        

    
def main():
    test = Solution()
    print(test.findTheDifference("abcd", "abcde"))
    print(test.findTheDifference("a", "aa"))
    print(test.findTheDifference("", 
                                 ""))

if __name__ == "__main__":
    main()